const Contact = ({contact, handleChange, checkFilter}) => {
    const img = contact.avatar;
    const chkBxId = `chkBx${contact.id}`;
    const show = checkFilter(contact.id);

    return (
       <div>
        {true ? 
        <li className="contact">
            <div className="contact-element" onClick={(event) => handleChange(event,contact.id)}>
                {img != null ? <img src={contact.avatar} alt="new"/> : <div className="blank">NO PICTURE</div>}
            </div>
            <div className="contact-element" onClick={(event) => handleChange(event,contact.id)}>| {contact.id}   {contact.first_name}</div>
            <div className="contact-element" onClick={(event) => handleChange(event,contact.id)}>| {contact.last_name}</div>
            <div className="contact-element">|<input type="checkbox" onClick={(event) => handleChange(event,contact.id)} id={chkBxId}/></div>
        </li>
        : ""}
        </div>
    );
}

export default Contact;
